import './App.css';
import logo from '../public/assets/logo.png';
import video from '../public/assets/video.webm'; // Updated to WEBM format

function App() {
    return (
        <div className="container">
            {/* Video Background */}
            <video
                className="background-video"
                autoPlay
                loop
                muted
                playsInline
            >
                <source src={video} type="video/webm"/>
                Your browser does not support the video tag.
            </video>


            {/* Logo */}
            <img src={logo} alt="Logo" className="logo"/>

            {/* Channel Name */}
            <h1 className="channel-name">PEGASUSFLY</h1>

            {/* Social Media Icons */}
            <div className="social-icons">
                <span className="emoji">üéµ</span> {/* TikTok */}
                <span className="emoji">‚ñ∂Ô∏è</span> {/* YouTube */}
                <span className="emoji">üéÆ</span> {/* Twitch */}
            </div>

            {/* Coming Soon Text */}
            <h2 className="coming-soon">COMING SOON</h2>
        </div>
    );
}

export default App;
